Ext.BLANK_IMAGE_URL="/static/js/lib/extjs/resources/images/default/s.gif";Ext.ns("imgmanager");Ext.onReady(function(){Ext.QuickTips.init();imgmanager.image_store.load();imgmanager.image_panel.render("extjs-main-panel-div")});imgmanager.select_image=function(){dv=imgmanager.dataview;record=dv.getSelectedRecords()[0];console.log(tinyMCE);if(tinyMCE!=undefined){var c=tinyMCEPopup.getWindowArg("win");var a=tinyMCEPopup.getWindowArg("input");var b=record.data.url;c.document.getElementById(a).value=b;if(typeof(c.ImageDialog)!="undefined"){if(c.ImageDialog.getImageData){c.ImageDialog.getImageData()}if(c.ImageDialog.showPreviewImage){c.ImageDialog.showPreviewImage(b)}}tinyMCEPopup.close()}};